# Parse operators list into lookup dictionary
operators = {}
for row in operator_list.splitlines():
    if row:
        charcode, stretch, form, lspace, rspace, prop = row.split('\t')
        if 'String' in charcode:
            char = charcode.split()[1]
        else:
            char = charcode.split()[0]
            
        params = {'lspace': lspace, 'rspace': rspace}
        for p in prop.split():
            if p != 'N/A':
                params[p] = 'true'
        operators[(char, form)] = params


integrals = ['∫', '∬', '∭', '∲', '∮', '∳', '∯', '∰', ]
fences = [op[0] for op, params in operators.items() if params.get('fence') == 'true'] + ['|', '∣', '❘', '‖']
names = set(op[0] for op in operators.keys())


def get_params(name: str, form: str) -> dict[str, str]:
    ''' Get parameters for the given operator name and form '''
    if form == 'none':
        # form of 'none' is given to single element mrows like {,}
        return {}

    params = operators.get((name, form), {})
    if not params:
        params = operators.get((name, 'infix'), {})
    if not params:
        params = operators.get((name, 'postfix'), {})
    if not params:
        params = operators.get((name, 'prefix'), {})

    return params.copy()
